import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import LandingPage from "./components/LandingPage";
import Home from "./components/Home";
import RecipeCreate from "./components/RecipeCreate";
import Details from "./components/Details";
import { Link } from 'react-router-dom';
function App() {
  return (
    //en cada path le digo renderizame este componente
    <BrowserRouter>
      <div className="App">
        <Routes>
        <Route exact path='/'>
          {/* <video muted loop autoPlay id="fullscreen-video"> */}
          <source src="https://cdn.dribbble.com/users/6191/screenshots/1816613/media/7cbb657541208e9c1f70a48d24e334df.gif" type="video/mp4"/>
          {/* </video> */}
        <div className='inicio'>
          <h1>Welcome!</h1>
          <Link to='/find'>
            <button className='botoninicio'>Inicio</button>
          </Link>
        </div>
      </Route>
          <Route exact path="/" element={<LandingPage />} />
          <Route path="/recipe/:id" element={<Details />} />
          <Route path="/recipe" element={<RecipeCreate />} />
          <Route path="/home" element={<Home />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}
export default App;

